import React from "react";
import { Link } from "react-router-dom";

export default function Thankyou() {
  return (
    <div className="posts">
      <div className="postItem">
        <span className="postTitle">Thank You For Your Reservation !!!</span>
        <div className="postListButton">
          <span>
            Please check your email for for more details about your reservation.
          </span>
          <button className="postButton">Back to Homepage</button>
        </div>
      </div>
    </div>
  );
}
